column5:
allowing the plugin to be
  * called at a later point by the `run` method.
  *
  * ```js
  * var use = require('use');
  *
  * // define a plugin
  * function foo(app) {
  *   // do stuff
  * }
  *
  * var app = function(){};
  * use(app);
  *
  * // register plugins
  * app.use(foo);
  * app.use(bar);
  * app.use(baz);
  * ```
  * @name .use
  * @param {Function} `fn` plugin function to call
  * @api public
  */Comment.Multiline
